import React, { Component} from 'react';


class Classversion extends React.Component {
    constructor(props) {
      super(props);
      this.state = {value: 'Lxi ₹ 6.10 Lakh'};
  
      this.handleChange = this.handleChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
    }
  
    handleChange(event) {
      this.setState({value: event.target.value});
    }
  
    handleSubmit(event) {
      alert('Version: ' + this.state.value);
      event.preventDefault();
    }
  
    render() {
      return (
        <form onSubmit={this.handleSubmit}>
          <label>
            Choose Version:
            <select value={this.state.value} onChange={this.handleChange}>
              <option value="Lxi ₹ 6.10 Lakh">BLxi ₹ 6.10 Lakh</option>
              <option value="Vxi ₹ 7.24 Lakh">Vxi ₹ 7.24 Lakh</option>
              <option value="Vxi MMT ₹ 7.84 Lakh">Vxi MMT ₹ 7.84 Lakh</option>
              <option value="Zxi ₹ 7.94 Lakh">Zxi ₹ 7.94 Lakh</option>
              <option value="Lxi ₹ 6.10 Lakh">BLxi ₹ 6.10 Lakh</option>
              <option value="Vxi ₹ 7.24 Lakh">Vxi ₹ 7.24 Lakh</option>
            </select>
          </label>
          <input type="submit" value="Submit" />
        </form>
      );
    }
  }
  



export default Classversion;
